    state = { clicked: false }

    handleClick = () => {
        this.setState({ clicked: !this.state.clicked })
    }
    render() {
        return (
            <div className='/'>
                {this.state.clicked ? <img src = 'loslagos_2' />
                    : <LoginButton onClick={this.handleLoginClick} />}
                   
             
            </div>
        );
    }

}

